import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

const Home = () => {
  return (
    <div>
      <Navbar />
      <div className="container">
        <h1 className="text-center mt-5">Welcome to the Grievance Website</h1>
        <p className="text-center">
          This platform allows users to submit and track their grievances easily. Admins can manage grievances and ensure timely resolutions.
        </p>
      </div>
      <Footer />
    </div>
  );
};

export default Home;
